import {createGlobalStyle} from 'styled-components';


export default createGlobalStyle`
    * {
        margin: 0;
        padding: 0;



    };

    body {
        background-color: rgb(2, 2, 2);
    };
    hr {
        border: 1px solid color(srgb rgb(7, 6, 6) green blue);
    };
`
